/* eslint nuclide-internal/no-commonjs: 0 */

// $FlowFB
module.exports = require('./jest/fb-e2e/nuclide-e2e.config.js');

{
  "lerna": "2.0.0",
  "packages": [
    "modules/*"
  ],
  "version": "0.7.3-dev",
  "command": {
    "publish": {
      "exact": true
    }
  }
}

